import React from 'react'


/************************************************
            [  Window  ]
************************************************/

window.addEventListener("load", (event) => {
    console.log("page is fully loaded");
  });


/************************************************
            [  Navigation bar: variables  ]
************************************************/

let hometab = document.getElementById("home-tab")
/************************************************
            [  Navigation bar: switcher  ]
************************************************/

let currentpage = "Home"
function currentpageF(){
    if (currentpage === "Home") {
        hometab.classList.remove("navitems")
        hometab.classList.add("focusednavitem")
    }

}
export default function VL() {
  return (
    <>
    <div id="vlwrapper">
        <div id = "navbarwrap">
            <div id = "loginwrap">
                <p>login</p>
            </div>
            <ul>
                <li id="home-tab" class="navitems">Home</li>
                <li id="service-tab" class="navitems">Services</li>
                <li id="about-tab"  class="navitems">About us</li>
                <li id="contact-tab"  class="navitems">Contact</li>
            </ul>
        </div>
        <div id="homepage">

        </div>
    </div>
    </>
  )
}
